import React, { useState } from 'react';
import './Navbar.css';
import { Link, Route, Routes } from 'react-router-dom';
import About from '../About/About';
import Contact from '../Contact/Contact';
import Employee from '../Employee/Employee';
import Crud from '../Crud/Crud';

function Navbar() {
  const [navOpen, setNavOpen] = useState(false);

  const toggleNav = () => {
    setNavOpen(!navOpen);
  };

  const closeNav = () => {
    setNavOpen(false);
  };

  return (
    <>
      <div className={`navbar ${navOpen ? 'open' : ''}`}>
        {/* <nav>
          <img
            src="https://media.istockphoto.com/id/1193845414/vector/overlapping-one-line-letter-t-logotype.jpg?s=612x612&w=0&k=20&c=l8rRi4CJzTPOFvIek_ANCTZuiAGvo69zBEzhbhMJFlg="
            width="55"
            height="55"
            alt="Logo Description"
          />
          <ul>
            <li>
              <Link className="name" to="/">
                <i className="fa-solid fa-house"></i> Home
              </Link>
            </li>
            <li>
              <Link className="name" to="/Contact">
                <i className="fa-solid fa-phone"></i> Contact
              </Link>
            </li>
            <li>
              <Link className="name" to="/About">
                <i className="fa-regular fa-address-card"></i> About
              </Link>
            </li>
            <li>
              <Link className="name" to="/Employee">
                Employee
              </Link>
            </li>
            <li>
              <Link className="name" to="/Crud">
                Crud
              </Link>
            </li>
          </ul>
        </nav>
      </div> */}

      <div class="maindiv">
    <button onclick="openNav()"><i class="fas fa-bars"></i></button>
    <ul class="mynav">
        <li>Home</li>
        <li>Contact Us</li>
        <li>About</li>
        <li>Services</li>
    </ul>
</div>
        <Routes>
          <Route exact path="/About" element={<About />} />
          <Route exact path="/Contact" element={<Contact />} />
          <Route exact path="/Employee" element={<Employee />} />
          <Route exact path="/Crud" element={<Crud />} />
        </Routes>
      </div>
    </>
  );
}

export default Navbar;
